import React, { useState } from 'react';
import * as icons from 'react-icons/fa';
import { Link } from 'react-router-dom';
import '../pages/'

function Navbar() {
    const [click, setClick] = useState(false);
    const handleClick = () => setClick(!click);
    const closeMobileMenu = () => setClick(false);
    const CUser = JSON.parse(window.localStorage.getItem('cUser'));
    const Logout = () => {
        window.localStorage.removeItem("cUser");
        window.location.href = "/";
    }
    return (
        <>
            <nav className='navbar'>
                <Link to='/' className='navbar-logo' onClick={closeMobileMenu}>Logo</Link>
                <div className='menu-icon' onClick={handleClick}>
                    {click ? <icons.FaTimes /> : <icons.FaBars />}
                </div>
                <ul className={click ? 'nav-menu active' : 'nav-menu'}>
                    <li className='nav-item'>
                        <Link to='/' className='nav-links' onClick={closeMobileMenu}> Home </Link>
                    </li>
                    <li className='nav-item'>
                        <Link to='/ManageUsers' className='nav-links' onClick={closeMobileMenu}> ManageUsers </Link>
                    </li>
                    <li className='nav-item'>
                        <Link to='/Contact' className='nav-links' onClick={closeMobileMenu}> Contact Us  </Link>
                    </li>
                    <li className='nav-item' >
                        <Link to='#' className='nav-links' onClick={closeMobileMenu}></Link>
                    </li>
                    <li className='nav-item'><a href="/#" onClick={Logout}>Logout <icons.FaSignOutAlt /></a></li>
                </ul>
            </nav>
        </>
    );
}

export default Navbar;
